import React from 'react';

import './App.css';
import GoalList from './components/GoalList';


const App = () => {
  const courseGoals = [{id: 'clg'},]

  return (
    <div className='course-goals'>
      <h2>Course Goals</h2>
      <GoalList />
    </div>
  );
};



export default App;
